ERModelExpressionItem.ExpressionAsString:
FIRSTORNULL(
	FILTER(
		ExtCodeValueTable,
		AND(
			ExtCodeValueTable.ExtCodeRelationTableId = TaxCodes.TableId,
			ExtCodeValueTable.ExtCodeRelationRecId = TaxCodes.RecId
		)
	)
)

FILTER(
	AddressTaxRegistrationNumberView,
	AND(
		AddressTaxRegistrationNumberView.DirPartyTableRecId = CompanyInfo.RecId,
		OR(
			AND(
				AddressTaxRegistrationNumberView.ValidFrom >= ReportContract.parmDateFrom,
				AddressTaxRegistrationNumberView.ValidFrom <= ReportContract.parmDateTo
			), 
			AND(
				AddressTaxRegistrationNumberView.ValidTo >= ReportContract.parmDateFrom,
				AddressTaxRegistrationNumberView.ValidTo <= ReportContract.parmDateTo
			), 
			AND(
				AddressTaxRegistrationNumberView.ValidFrom <= ReportContract.parmDateFrom, 
                AddressTaxRegistrationNumberView.ValidTo >= ReportContract.parmDateFrom
			)
		)
	)
)

WHERE(
    '$CustomersJoin'.'$SAFTCustView'.'CustTableDefaultDimension.Dimension'.'Main account and dimensions',
    AND(
        OR(
            '$CustomersJoin'.'$SAFTCustView'.'CustTableDefaultDimension.Dimension'.'Main account and dimensions'.Definition.'Report column name' <> "",
            '$CustomersJoin'.'$SAFTCustView'.'CustTableDefaultDimension.Dimension'.'Main account and dimensions'.Definition.Name <> ""
        ),
        '$CustomersJoin'.'$SAFTCustView'.'CustTableDefaultDimension.Dimension'.'Main account and dimensions'.Value.Code <> ""
    )
)

WHERE(
    '$VendorsJoin'.'$SAFTVendView'.'VendTableDefaultDimension.Dimension'.'Main account and dimensions',
    AND(
        OR(
            '$VendorsJoin'.'$SAFTVendView'.'VendTableDefaultDimension.Dimension'.'Main account and dimensions'.Definition.'Report column name' <> "",
            '$VendorsJoin'.'$SAFTVendView'.'VendTableDefaultDimension.Dimension'.'Main account and dimensions'.Definition.Name <> ""
        ),
        '$VendorsJoin'.'$SAFTVendView'.'VendTableDefaultDimension.Dimension'.'Main account and dimensions'.Value.Code <> ""
    )
)
